import base64
from hashlib import sha256
from itertools import cycle

def genkey(pwd):
    return sha256(pwd.encode()).digest()

def dec(token, pwd):
    try:
        key = genkey(pwd)
        data = base64.b64decode(token)
        out = bytes([a ^ b for a, b in zip(data, cycle(key))])
        return out.decode()
    except:
        return None  # Salah password

